const SvgMap: React.FC<SvgMapProps> = ({ 
  selectedTiles, 
  tileColors, 
  colorLabels, 
  onTileClick,
  selectedGates = [],
  gateColors = {},
  onGateClick,
  selectedShrines = [],
  shrineColors = {},
  onShrineClick
}) => {
  const getTileLabel = (id: number) => {
    const tileColor = tileColors[id];
    if (tileColor && colorLabels[tileColor] && colorLabels[tileColor].trim() !== '') {
      return colorLabels[tileColor];
    }
    return null;
  };

  return (
    <svg
      version="1.1"
      xmlns="http://www.w3.org/2000/svg"
      viewBox="0 0 8192 8192"
      style={{ width: '100%', height: '100%' }}
    >
      {tilePaths.map((tile) => {
        // Use tileColors if present, else defaultFill
        const fill = tileColors[tile.id] || tile.defaultFill;
        // Optionally, highlight with a border if selected
        const isSelected = selectedTiles.includes(tile.id);
        const label = getTileLabel(tile.id);
        
        return (
          <g key={tile.id}>
            <path
              d={tile.d}
              fill={fill}
              stroke={isSelected ? '#fff' : '#333'}
              strokeWidth={isSelected ? 3 : 2}
              style={{ cursor: 'pointer', transition: 'stroke 0.2s, stroke-width 0.2s' }}
              onClick={() => onTileClick(tile.id)}
            />
            {label && (
              <text
                x="800"
                y="800"
                textAnchor="middle"
                dominantBaseline="middle"
                fill="#ffffff"
                fontSize="10"
                fontWeight="bold"
                stroke="#000000"
                strokeWidth="0.5"
                style={{
                  pointerEvents: 'none',
                  textShadow: '1px 1px 2px rgba(0,0,0,0.8)',
                }}
              >
                {label}
              </text>
            )}
          </g>
        );
      })}
      
      {/* Render Gates */}
      {gates.map((gate) => {
        const fill = gateColors[gate.id] || '#ff6b6b'; // Default red color for gates
        const isSelected = selectedGates.includes(gate.id);
        
        return (
          <g key={gate.id}>
            <rect
              x={gate.x}
              y={gate.y}
              width={gate.width}
              height={gate.height}
              fill={fill}
              stroke={isSelected ? '#333' : '#000'}
              strokeWidth={isSelected ? '3' : '1'}
              opacity={0.8}
              style={{ cursor: onGateClick ? 'pointer' : 'default' }}
              onClick={() => onGateClick && onGateClick(gate.id)}
            />
            {/* Optional gate label/number */}
            <text
              x={gate.x + gate.width / 2}
              y={gate.y + gate.height / 2}
              textAnchor="middle"
              dominantBaseline="middle"
              fill="#ffffff"
              fontSize="8"
              fontWeight="bold"
              style={{ pointerEvents: 'none' }}
            >
              G
            </text>
          </g>
        );
      })}

      {/* Render Shrines */}
      {shrines.map((shrine) => {
        const fill = shrineColors[shrine.id] || '#9c27b0'; // Default purple color for shrines
        const isSelected = selectedShrines.includes(shrine.id);
        
        return (
          <g key={shrine.id}>
            <path
              d={shrine.d}
              fill={fill}
              stroke={isSelected ? '#333' : '#000'}
              strokeWidth={isSelected ? '3' : '1'}
              opacity={0.8}
              style={{ cursor: onShrineClick ? 'pointer' : 'default' }}
              onClick={() => onShrineClick && onShrineClick(shrine.id)}
            />
            {/* Optional shrine label */}
            <text
              x={0} // Will need to calculate center based on path bounds
              y={0}
              textAnchor="middle"
              dominantBaseline="middle"
              fill="#ffffff"
              fontSize="12"
              fontWeight="bold"
              style={{ pointerEvents: 'none' }}
            >
              S
            </text>
          </g>
        );
      })}
    </svg>
  );
};

export default SvgMap;